import React from 'react';
import { 
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import { Sidebar } from './components';
import { 
  Budget, 
  Inventory, 
  Reports, 
  Recipes, 
  Orders, 
  Tasks 
} from './pages';
import 'rsuite/dist/styles/rsuite-default.css';

class App extends React.Component {
  render() {
    return(
      <Router>
        <div>
          <Sidebar />
          <Switch>
            <Route path='/budget'>
              <Budget />
            </Route>
            <Route path='/inventory'>
              <Inventory />
            </Route>
            <Route path='/reports'>
              <Reports />
            </Route>
            <Route path='/Recipes'>
              <Recipes />
            </Route>
            <Route path='/orders'>
              <Orders />
            </Route>
            <Route path='/tasks'>
              <Tasks />
            </Route>
          </Switch>
        </div>
      </Router>
      
    )
  }
}

export default App;
